import React from 'react';
import LoginPage from './LoginPage.png';
import ProductPage from './ProductPage.png';
import '../styles/Style.css';


const Project = () => {
    return (
        <div className='project' >
            <img height={600} width={400} className='project-img' src={LoginPage} />
            <img height={335} width={700} className='project-img' src={ProductPage} />
        </div>
    )
}

export default Project
